import React from 'react'
import Nav from './Nav'

function Index() {
  const slides = document.querySelectorAll('.slide');
let current = 0;

function showSlide(index) {
  slides.forEach((slide, i) => {
    slide.classList.remove('active');
    if (i === index) {
      slide.classList.add('active');
    }
  });
}

function nextSlide() {
  current = (current + 1) % slides.length;
  showSlide(current);
}

  return (
    <div>
      <Nav />
   <div>
   <header>
    <div className="container">
      <h1 className="logo">Hotel Paradise</h1>
      <nav>
        <ul>
          <li><a href="#">Home</a></li>
          <li><a href="#">Rooms</a></li>
          <li><a href="#">Dining</a></li>
          <li><a href="#">Contact</a></li>
        </ul>
      </nav>
    </div>
  </header>

  <section className="slider">
    <div className="slides">
     <img class="slide active" src='data:image/jpeg;base64,' />
      <img class="slide" src='data:image/jpeg;base64,' />
       <img class="slide" src='data:image/jpeg;base64,' />
    </div>
  </section>

  <section className="welcome">
    <div className="container">
      <h2>Welcome to Hotel Paradise</h2>
      <p>Relax in comfort and elegance. Discover premium amenities, luxury rooms, and world-className service.</p>
      <a href="#" className="btn">Book Your Stay</a>
    </div>
  </section>
</div></div>
  )
}

export default Index